import React from 'react';
import Header from '../components/Header';

class Favorites extends React.Component {
  componentDidMount() {
    const favorites = JSON.parse(localStorage.getItem('favorite'));

  }

  render() {
    return (
      <>
        <Header />
        <h1>Favorites</h1>
      </>
    );
  }
}

export default Favorites;
